import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom';
import UserRegistration from './components/UserRegistration';
import HomePage from './components/HomePage';
import AccountPage from './components/AccountPage';
import LoginPage from './components/LoginPage';
import CreateWorkoutsForm from './components/CreateWorkoutsForm';
import UserWorkouts from './components/UserWorkouts';
import SubscriptionPage from './components/SubscriptionPage';
import { Nav } from 'react-bootstrap';


function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const navigate = useNavigate();

  React.useEffect(() => {
    navigate('/home');
  }, [navigate])
  return (
    <Router>
      <Routes>

        <Route path="/home" element={<HomePage isAuthenticated={isAuthenticated} />} />
        {/* <Route path="/" element={<UserRegistration />} /> */}
        <Route path="/account" element={<AccountPage />} />
        <Route path='/create-workout' element={<CreateWorkoutsForm/>}></Route>
        <Route path='/my-workouts' element={<UserWorkouts/>}></Route>
        <Route
          path='/login'
          element={<LoginPage />}
        />
        <Route path='/plans' element={<SubscriptionPage/>}></Route>
      </Routes>
    </Router>
  );
}

export default App;
